  false,\n\t\"url\": null,\n\t\"notes\": \"NCEI Accession 0100218 includes Surface
  underway data collected from Munida in the South Pacific Ocean from 2004-01-26 to
  2006-07-30. These data include Partial pressure (or fugacity) of carbon dioxide
  - water, SALINITY and SEA SURFACE TEMPERATURE. The instruments used to collect these
  data include Carbon dioxide (CO2) gas analyzer and Shower head chamber equilibrator
  for autonomous carbon dioxide (CO2) measurement.nnThese data were collected by Dr
  Kim I Currie of National Institute of Water and Atmospheric Research Limited as
  part of the Time_Series_Munida data set. CDIAC associated the following cruise ID(s)
  with this data set: 61MU20040126nnThe Global CO2 Time-series and Moorings Project
  involves international groups from 18 countries who have mounted sensors on moored
  buoys to provide high resolution time-series measurements of atmospheric boundary
  layer and surface ocean CO2 partial pressure (pCO2). The CO2 Time-series and Moorings
  Project is coordinated by UNESCO International Ocean Carbon Coordination Project
  (IOCCP).\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"bbox-east-long\",\n\t\t\"value\":
